import { gql } from 'apollo-boost';

const getBookQuery = gql`
  {
    books {
      name
      id
    }
  }
`

const getAuthorsQuery = gql`
  {
    authors {
      name
      id
    }
  }
`

module.exports = {
  getBookQuery,
  getAuthorsQuery
}
